import './App.css';
import { useState } from 'react';

function App() {
  const [state, setState] = useState([]);

  const fetchTeams = () => {
    fetch('/competitions/')
        .then(res => res.json())
        .then(data => setState(data.toString()));
  }

  const printState = Object.values(state);

  return (
    <section>
      <button onClick={() => fetchTeams()}>GO</button>
      <div>{printState.map((s, i) => console.log(s.name, i))}</div>
    </section>
  );
}

export default App;
